import React from 'react'
import {
    Switch,
    Route,
    useRouteMatch
} from "react-router-dom";
import Home from './dachboard/Home';
import SideMenu from './components/SideMenu';
import Entitys from './dachboard/Entitys';

function Dachboard() {
    let match = useRouteMatch();
    console.log(match.url)
    return (
        <div style={{ display: 'flex', justifyContent: 'space-between', background: '#F9F9F9' }}>
            <SideMenu />
            <div style={{ flex: 4.4 }}>
                <Switch>
                    <Route path={`${match.path}/entities`}>
                        <Entitys />
                    </Route>
                    <Route path={`${match.path}/agent`}>
                        <Home />
                    </Route>
                    <Route path={`${match.path}/`}>
                        <Home />
                    </Route>
                </Switch>
            </div>
        </div>
    )
}

export default Dachboard
